question = "Vilka lärare uppger i större utsträckning att de har rätt förutsättningar att ge ledning och stimulans?"
answer = "Lärare i gymnasieskolan upplever i större utsträckning än lärare i grundskolan att de alltid eller oftast har rätt förutsättningar att ge ledning och stimulans – knappt hälften jämfört med drygt en tredjedel. I grundskolan är högstadielärare mer positiva än lågstadielärarna om dessa förutsättningar"
